import { Route, Routes } from 'react-router-dom';

import './App.css';

export default function App() {
  return (
    <div>
      <Route exact path='/henry'>
        <div className="App">
          <h1>Henry Food</h1>
        </div>
      </Route>
    </div>
  );
};


